import React from 'react';
import ReactDOM from 'react-dom';
import { HashRouter } from 'react-router-dom';
import App from './App';

ReactDOM.render(
  <HashRouter>
    {! <App /> ? (<img src="./img/category/spinner.gif" />)
    : <App />}
  </HashRouter>,
  document.getElementById('root'),
);
